import React from 'react';
import {Link} from 'react-router-dom';
import styles from './styles';
import FormControl from '@material-ui/core/FormControl';
import InputLabel from '@material-ui/core/InputLabel';
import Input from '@material-ui/core/Input';
import Paper from '@material-ui/core/Paper';
import withStyles from '@material-ui/core/styles/withStyles';
import CssBaseline from '@material-ui/core/CssBaseline';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import firebase from 'firebase';

class LoginComponent extends React.Component{

     render(){
         const {classes} = this.props;
         return (
             <main className = {classes.main}>
                 <CssBaseline />
            <Paper className ={classes.paper}>
                <Typography companent ='h1' variant='h5'>Log In!</Typography>
                <form className={classes.form} onSubmit ={(e) => this.submitLogin(e)}>
                <FormControl required fullWidth margin='normal'>
                    <InputLabel htmlFor='login-email-input'>Enter Your Email</InputLabel>
                    <Input autoComplete='email' autoFocus id='login-email-input' onChange={(e) => this.userTyping('email', e)}></Input>
                </FormControl>
                <FormControl required fullWidth margin='normal'>
                    <InputLabel htmlFor='login-password-input'>Enter Your Password</InputLabel>
                    <Input type='password' id='login-password-input' onChange={(e) => this.userTyping('password', e)}></Input>
                </FormControl>
                <Button fullWidth variant='contained' color ='primary' className={classes.submit}>Log In</Button>
                </form>
                <Typography component='h7' variant='h8' className={classes.noAccountHeader}>Don't Have An Account?</Typography>
                 <Link className ={classes.signUpLink} to='/signup'>Sign Up</Link>
            </Paper>
            </main>
         );
     }
     userTyping=(type, e) =>{
        console.log(type, e);
     }
     submitLogin=(e) =>{
         console.log('Submiting');
     }
}
export default withStyles(styles)(LoginComponent);
